    "2013-03-16T01:14:09.145233",nt"name": "two-dimensional-model-results-of-telluric-magnetotelluric-data-from-the-tuscarora-area-elko-cou",nt"isopen":
    false,nt"url": null,nt"notes": "Two-dimensional modeling of T-MT data taken
    at the Tuscarora Geothermal Exploration unit has shown that in this area the TM-Mode
    is insensitive in resolving conductivity inhomogeneities below a depth of about
    2 km. Computer interpretive models showing a large conductive zone beneath the hot
    spring area at a depth of 2 km are compared with models in which this conductive
    zone is restricted to the near surface. Acceptable fits between observed apparent
    resistivity and calculated resistivity, within the accuracy of the field data, have
    also been obtained with alternate models . This non-uniqueness is inherent in the
    two-dimensional models themselves and is further complicated by the geologic setting
    where three-dimensional effects result from near-surface conductive bodies. Current
    channeling within the conductive sediments of Independence Valley may al so li mit
    the ability to resolve postulated, deep conductivity inhomogeneities .n  Any interpretation
    of T-MT data, possibly leading to a deep exploration drill test, should be evaluated
    through a sensitivity analysis (i.e., several alternate models). Three dimensional
    effects should also be evaluated to the ext ent possible. Finally, supporting evidence
    derived from alternate exploration techniques should be integrated with T-MT interpretive
    conclusions .",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
